import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 55.1-2184 Penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2184.md","filePath":"vacode/55.1-2184.md"}'),r={name:"vacode/55.1-2184.md"},n=t('<h1 id="§-55-1-2184-penalties" tabindex="-1">§ 55.1-2184 Penalties. <a class="header-anchor" href="#§-55-1-2184-penalties" aria-label="Permalink to &quot;§ 55.1-2184 Penalties.&quot;">​</a></h1><p>Any person who willfully violates § <a href="/vacode/55.1-2155/">55.1-2155</a>, <a href="/vacode/55.1-2158/">55.1-2158</a>, <a href="/vacode/55.1-2159/">55.1-2159</a>, <a href="/vacode/55.1-2162/">55.1-2162</a>, <a href="/vacode/55.1-2164/">55.1-2164</a>, <a href="/vacode/55.1-2176/">55.1-2176</a>, or <a href="/vacode/55.1-2181/">55.1-2181</a> or any regulation adopted under, or order issued pursuant to, § <a href="/vacode/55.1-2174/">55.1-2174</a>, or any person who willfully in an application for registration makes any untrue statement of a material fact or omits to state a material fact, is guilty of a misdemeanor and may be (i) fined not less than $1,000 or double the amount of gain from the transaction, whichever is larger, but not more than $50,000 or (ii) imprisoned for not more than six months, or both, for each offense.</p><p>1982, c. 277, § 55-506; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),i=[n];function s(c,l,d,f,h,_){return a(),o("div",null,i)}const u=e(r,[["render",s]]);export{m as __pageData,u as default};
